features:
# Prefix: Languagesystems
# automatic
languagesystem DFLT dflt;

languagesystem latn dflt;
languagesystem latn AZE;
languagesystem latn CRT;
languagesystem latn KAZ;
languagesystem latn TAT;
languagesystem latn TRK;
languagesystem latn ROM;
languagesystem latn MOL;
languagesystem latn CAT;
languagesystem latn NLD;


feature aalt {
# automatic
feature locl;
feature ordn;
feature case;
feature ss01;
feature ss02;

} aalt;

feature ccmp {
# automatic
lookup ccmp_DFLT_1 {
	@CombiningTopAccents = [acutecomb brevecomb caroncomb circumflexcomb commaturnedabovecomb dieresiscomb dotaccentcomb gravecomb hungarumlautcomb macroncomb ringcomb tildecomb];
	lookupflag UseMarkFilteringSet @CombiningTopAccents;
	sub i' @CombiningTopAccents by idotless;
	sub j' @CombiningTopAccents by jdotless;
} ccmp_DFLT_1;

} ccmp;

feature locl {
# automatic
script latn;
language AZE;
lookup locl_latn_0 {
	sub i by idotaccent;
} locl_latn_0;
language CRT;
lookup locl_latn_0;
language KAZ;
lookup locl_latn_0;
language TAT;
lookup locl_latn_0;
language TRK;
lookup locl_latn_0;

script latn;
language ROM;
lookup locl_latn_1 {
	sub Scedilla by Scommaaccent;
	sub scedilla by scommaaccent;
	sub Tcedilla by Tcommaaccent;
	sub tcedilla by tcommaaccent;
} locl_latn_1;
language MOL;
lookup locl_latn_1;

script latn;
language CAT;
lookup locl_latn_2 {
	sub l periodcentered' l by periodcentered.loclCAT;
	sub L periodcentered' L by periodcentered.loclCAT.case;
} locl_latn_2;

script latn;
language NLD;
lookup locl_latn_3 {
	sub iacute j' by jacute;
	sub Iacute J' by Jacute;
} locl_latn_3;

} locl;

feature ordn {
# automatic
sub [zero one two three four five six seven eight nine] [A a]' by ordfeminine;
sub [zero one two three four five six seven eight nine] [O o]' by ordmasculine;

} ordn;

feature case {
# automatic
sub periodcentered.loclCAT by periodcentered.loclCAT.case;

} case;

feature rlig {
# automatic
script latn;
lookup rlig_latn_0 {
	lookupflag IgnoreMarks;
	sub f b by f_b.rlig;
	sub f h by f_h.rlig;
	sub f k by f_k.rlig;
	sub f l by f_l.rlig;
	sub f thorn by f_thorn.rlig;
} rlig_latn_0;

} rlig;

feature ss01 {
featureNames {
  name "Uncial e";
};
# automatic
sub e by e.ss01;
sub eacute by eacute.ss01;
sub ecaron by ecaron.ss01;
sub ecircumflex by ecircumflex.ss01;
sub edieresis by edieresis.ss01;
sub edotaccent by edotaccent.ss01;
sub egrave by egrave.ss01;
sub emacron by emacron.ss01;
sub eogonek by eogonek.ss01;
sub etilde by etilde.ss01;

} ss01;

feature ss02 {
featureNames {
  name "U with stem";
};
# automatic
sub U by U.ss02;
sub Uacute by Uacute.ss02;
sub Ubreve by Ubreve.ss02;
sub Ucaron by Ucaron.ss02;
sub Ucircumflex by Ucircumflex.ss02;
sub Udieresis by Udieresis.ss02;
sub Ugrave by Ugrave.ss02;
sub Uhungarumlaut by Uhungarumlaut.ss02;
sub Umacron by Umacron.ss02;
sub Uogonek by Uogonek.ss02;
sub Uring by Uring.ss02;
sub Utilde by Utilde.ss02;

} ss02;
